import './imageslider.css'

export default function ImageSlider() {

    let createImage = new Image()
    createImage.src = "https://images.unsplash.com/photo-1501959915551-4e8d30928317?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=3687&q=80"

    const imageBox = [{
            id: 0,
            image: createImage.src = "https://images.unsplash.com/photo-1501959915551-4e8d30928317?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=3687&q=80",
        },
        {
            id: 1,
            image: "https://unsplash.com/photos/yi2lhiIcTuA"
        }
    ]

    const [currentImage, setCurrentImage] = useState()

    return (
        <div>
            <div>
                {imageBox[0].image}
            </div>
        </div>
    )
}
